  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:10.510131\",\n\t\"name\": \"mercury-in-fishes-of-the-j-n-ding-darling-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"From June 26 to 30,1990 spotted gar (Lepisosteus
  oculatus), spotted seatrout (Cynoscion nebulosus), gafftopsail catfish (Bagre marinus),
  and largemouth bass (Micropterus salmoides) were collected from selected locations
  at the J. N. \"Ding\" Darling National Wildlife Refuge, Lee County, Florida for
  analysis of mercury concentrations in muscle tissue (fillets). Spotted gar (n =
  18) ranged from 408 to 675 mm (16.1-26.6 in) total length (TL). Mercury concentrations
  (range=0.05-0.26 mg/kg wet weight; ppm) in gar were all less than the Florida limited-consumption
  concentration of 0.5 ppm wet weight. Spotted seatrout (n = 11) were from 270 to
  520 mm (10.6-20.5 in) in length and mercury concentrations ranged from 0.21 to 0.59
  ppm. Eighteen percent (n = 2) of the seatrout had mercury levels that exceeded 0.5
  ppm wet weight. Gafftopsail catfish (n=3) ranged from 417 to 466 mm (16.4 -18.3
  in) in length and mercury concentrations in fillets ranged from 0.2 4 to 0.68 ppm.
  Two of the three catfish had mercury concentrations exceeding 0.5 ppm. A single
  largemouth bass (398 mm; 15.7 in) contained 0.12 ppm mercury. None of the fish analyzed
  contained concentrations which exceeded the no-consumption concentration (1.5 ppm).
  Although all the locations sampled appeared to provide environments conducive for
  accumulation of mercury in fish; there was no significant difference in concentrations
  in spotted gar caught in the Sanibel River (Bailey Tract station) and those caught
  in the River east of Donax Road. As all fish collected had mercury concentrations
  in excess of 0.1 ppm, several fish and wildlife trust species may be at risk when
  utilizing the habitat areas sampled. Additional environmental contaminant studies
  to determine the scope, magnitude and effects of mercury contamination are recommended.\",\n\t\"license_title\":
